import React from "react";
import "./Contact.css";
const Contact = () => {
  return (
    <div className="container">
      <h1 className="contact-h1">Contact Us</h1>{" "}
      <p className="content">
        Thank you for stopping by FeelGoodFoodie.net. We would love to hear from
        you about any questions, comments or inquiries. You can email our team
        at Recipe@Finder.com.
      </p>{" "}
      <h2 className="subheading">RECIPE QUESTIONS </h2>If you have questions or
      feedback about a recipe, please leave a comment directly below the recipe
      in the comment section of the post. That way other readers may see and
      benefit from learning about your question or feedback. We love hearing how
      recipes went and if you ever need help troubleshooting a recipe!
    </div>
  );
};
export default Contact;
